import logo from './logo.svg';
import './App.css';

function App() {
  const predictors = [['sex', 'Sex'], 
                      ['age', 'Age'], 
                      ['bmi', 'BMI'], 
                      ['weight', 'Weight'], 
                      ['height', 'Height'], 
                      ['initialo2', 'O2'], 
                      ['initialhr', 'Heart Rate'], 
                      ['initialrr', 'Respiratory Rate']]
  return (
    <div className="App">
      <form>
      {predictors.map(([c, v]) => {
        return (<div className='predictor'>
        <label id={`label_${c}`} >{v}</label>
        <input id={c} />
        </div>)
      })}
      <input type="submit" value="Calculate AHI" />
      </form>
    </div>
  );
}

export default App;
